import mido
import numpy as np

# MIDI note number to frequency conversion
def midi_to_freq(note):
    return 440.0 * (2 ** ((note - 69) / 12.0)) if note > 0 else 0

def parse_midi(file_path):
    mid = mido.MidiFile(file_path)
    devices = []  # 4D list: [Device (track)][Monophonic sequence][[freq, duration]]

    for track in mid.tracks:
        monophonic_sequences = {}  # Dictionary to store per-channel note sequences
        time_elapsed = 0  # Absolute time in ticks

        active_notes = {}  # Stores active note start times per channel
        last_note_end = {}  # Stores the end time of the last note for each channel

        for msg in track:
            time_elapsed += msg.time  # Track absolute time

            if msg.type == 'note_on' and msg.velocity > 0:  # Note on
                if msg.channel not in monophonic_sequences:
                    monophonic_sequences[msg.channel] = []
                    last_note_end[msg.channel] = 0

                if msg.channel in active_notes:
                    # End the previous note
                    note, start_time = active_notes[msg.channel]
                    duration = time_elapsed - start_time
                    if duration >= 64:
                        duration = round(duration / 64) * 64
                        monophonic_sequences[msg.channel].append([midi_to_freq(note), duration])
                    last_note_end[msg.channel] = time_elapsed
                
                # Start new note
                active_notes[msg.channel] = (msg.note, time_elapsed)

                # Add a rest if there was a gap
                if last_note_end[msg.channel] < time_elapsed:
                    rest_duration = time_elapsed - last_note_end[msg.channel]
                    if rest_duration >= 64:
                        rest_duration = round(rest_duration / 64) * 64
                        monophonic_sequences[msg.channel].append([0, rest_duration])

            elif msg.type == 'note_off' or (msg.type == 'note_on' and msg.velocity == 0):  # Note off
                if msg.channel in active_notes and active_notes[msg.channel][0] == msg.note:
                    note, start_time = active_notes.pop(msg.channel)
                    duration = time_elapsed - start_time
                    if duration >= 64:
                        duration = round(duration / 64) * 64
                        monophonic_sequences[msg.channel].append([midi_to_freq(note), duration])
                    last_note_end[msg.channel] = time_elapsed

        # Close any remaining notes
        for channel, (note, start_time) in active_notes.items():
            duration = time_elapsed - start_time
            if duration >= 64:
                duration = round(duration / 64) * 64
                monophonic_sequences[channel].append([midi_to_freq(note), duration])

        # Convert dictionary to list and append to devices
        if monophonic_sequences:
            devices.append([seq for seq in monophonic_sequences.values()])

    return devices

# Example usage
midi_file = "tetris3 (1).mid"  # Replace with your MIDI file path
parsed_midi = parse_midi(midi_file)

# Print the parsed MIDI data
# import pprint
